def __eq__(self, that):
        if type(self) != type(that):
            return False
        if self.__dict__.keys() != that.__dict__.keys():
            return False
        for k, v in self.__dict__.items():
            if v != that.__dict__[k]:
                return False
        return True

def resolve(self, context):
        c = Context(self.parent, self.islist)
        for name, r in self.resolvables.items():
            if name is not None:
                c.resolvables[name] = r
        defaults = self.resolvables.get(None)
        if defaults is not None:
            for item in c.resolvables:
                for dn, dr in defaults.resolvables.items():
                    if dn not in item.resolvables.keys():
                        item.resolvables[dn] = dr
        return c

def temporarily(self, name, resolvable, block): 
        oldornone = self.resolvables.get(name)
        self.resolvables[name] = resolvable
        try:
            return block()
        finally:
            if oldornone is None:
                del self.resolvables[name]
            else:
                self.resolvables[name] = oldornone

def map(context, objs, *args):
        if 1 == len(args):
            expr, = args
            def g():
                for k, v in objs.resolve(context).resolvables.items():
                    c = v.createchild()
                    c.label = Text(k)
                    yield expr.resolve(c)
            return List(list(g()))
        elif 2 == len(args):
            name, expr = args
            name = name.resolve(context).cat()
            def g():
                for obj in objs.resolve(context):
                    c = context.createchild()
                    c[name,] = obj
                    yield expr.resolve(c)
            return List(list(g()))
        else:
            kname, vname, expr = args
            kname = kname.resolve(context).cat()
            vname = vname.resolve(context).cat()
            def g():
                for k, v in objs.resolve(context).resolvables.items():
                    c = context.createchild()
                    c[kname,] = Text(k)
                    c[vname,] = v
                    yield expr.resolve(c)
            return List(list(g()))

