def which(exe=None):


    if not exe:
        log.error("No executable was passed to be searched by salt.utils.path.which()")
        return None


    def is_executable_common(path):

        return os.path.isfile(path) and os.access(path, os.X_OK)

    def resolve(path):

        while os.path.islink(path):
            res = readlink(path)



            if not os.path.isabs(res):
                directory, _ = os.path.split(path)
                res = join(directory, res)
            path = res
        return path


    def has_executable_ext(path, ext_membership):

        p, ext = os.path.splitext(path)
        return ext.lower() in ext_membership


    res = salt.utils.stringutils.to_unicode(os.environ.get("PATH", ""))
    system_path = res.split(os.pathsep)


    if not salt.utils.platform.is_windows():
        res = set(system_path)
        extended_path = [
            "/sbin",
            "/bin",
            "/usr/sbin",
            "/usr/bin",
            "/usr/local/sbin",
            "/usr/local/bin",
        ]
        system_path.extend([p for p in extended_path if p not in res])


    if salt.utils.platform.is_windows():

        res = salt.utils.stringutils.to_str(os.environ.get("PATHEXT", ".EXE"))





        pathext = res.split(os.pathsep)
        res = {ext.lower() for ext in pathext}


        _, ext = os.path.splitext(exe)
        if ext.lower() in res:
            pathext = [""]

            is_executable = is_executable_common



        else:
            is_executable = lambda path, membership=res: is_executable_common(
                path
            ) and has_executable_ext(path, membership)

    else:

        pathext = [""]


        is_executable = is_executable_common





    if is_executable(exe):
        return exe


    for path in system_path:
        p = join(path, exe)


        for ext in pathext:
            pext = p + ext
            rp = resolve(pext)
            if is_executable(rp):
                return p + ext
            continue
        continue


    log.trace(
        "'%s' could not be found in the following search path: '%s'", exe, system_path
    )
    return None

def join(*parts, **kwargs):

    parts = [salt.utils.stringutils.to_str(part) for part in parts]

    kwargs = salt.utils.args.clean_kwargs(**kwargs)
    use_posixpath = kwargs.pop("use_posixpath", False)
    if kwargs:
        salt.utils.args.invalid_kwargs(kwargs)

    pathlib = posixpath if use_posixpath else os.path


    parts = [pathlib.normpath(p) for p in parts]

    try:
        root = parts.pop(0)
    except IndexError:

        return ""

    root = salt.utils.stringutils.to_unicode(root)
    if not parts:
        ret = root
    else:
        stripped = [p.lstrip(os.sep) for p in parts]
        ret = pathlib.join(root, *salt.utils.data.decode(stripped))
    return pathlib.normpath(ret)

def to_str(s, encoding=None, errors="strict", normalize=False):


    def _normalize(s):
        try:
            return unicodedata.normalize("NFC", s) if normalize else s
        except TypeError:
            return s

    if encoding is None:

        encoding = ("utf-8", __salt_system_encoding__)
    if not isinstance(encoding, (tuple, list)):
        encoding = (encoding,)

    if not encoding:
        raise ValueError("encoding cannot be empty")

    if isinstance(s, str):
        return _normalize(s)

    exc = None
    if isinstance(s, (bytes, bytearray)):
        for enc in encoding:
            try:
                return _normalize(s.decode(enc, errors))
            except UnicodeDecodeError as err:
                exc = err
                continue



        raise exc  
    raise TypeError(f"expected str, bytes, or bytearray not {type(s)}")

def _remove_circular_refs(ob, _seen=None):

    if _seen is None:
        _seen = set()
    if id(ob) in _seen:


        log.exception(
            "Caught a circular reference in data structure below."
            "Cleaning and continuing execution.\n%r\n",
            ob,
        )
        return None
    _seen.add(id(ob))
    res = ob
    if isinstance(ob, dict):
        res = {
            _remove_circular_refs(k, _seen): _remove_circular_refs(v, _seen)
            for k, v in ob.items()
        }
    elif isinstance(ob, (list, tuple, set, frozenset)):
        res = type(ob)(_remove_circular_refs(v, _seen) for v in ob)

    _seen.remove(id(ob))
    return res

